import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { Consumer } from './show'


class C extends Component {
  render() {
    return (
      <div >
        <Consumer >
          {(value) =>
            <div>我是C组件,接收的值是：{value}</div>
          }

        </Consumer>
      </div>

    )
  }
}
export default withRouter(C);
